import React from 'react';
import CarouselWithTrees from './assets/Carousel'; // Make sure to import the updated Carousel

function App() {
  return (
    <div>
      <h1>Task Trees in Carousel</h1>
      <CarouselWithTrees />
    </div>
  );
}

export default App;
